displayName: K8S-Custom
description: Deploy a Custom Size Kubernetes Cluster (demo time)
category:
  - capi-custom
type: catalog
allowMultipleInstances: true
scope:
  - workspace
overview: |-
  ## Overview
  # Create Custom Sized Clusters with one or more worker pools
  ### Example Values:
  ```
  cluster:
    k8s_svc_vip_range: 10.120.1.25-10.120.1.29
    external_vip: 170.205.64.202
  controlplane:
    vip_ip: 10.120.1.25
    replicas: 3
    poolClass: small   
  workerNodePools:
  - poolName: small-pool
    replicas: 2
    poolClass: small
  - poolName: large-pool
    replicas: 2
    poolClass: large
  ```  
